INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('15', '7', '包裹签收', '<p>1.关于收货信息<br />\r\n1)收件人请填写中文名字，如使用非中文名字，请务必与身份证或护照保持完全一致，以保证您的包裹可以准确送达。<br />\r\n2)寄件地址请填写详细地址，以避免因地址不详造成您无法按时收到商品。<br />\r\n3) 如因收件人信息有误，造成包裹无法送达或丢失，本网不承担任何责任。<br />\r\n2.关于发货<br />\r\n1)本网在核对您所订购的商品、邮寄地址、款项支付等信息无误后确认订单，订单确认后会尽快给您发货。<br />\r\n2)发货时间：在您订购时，商品详情页面有预计发货时间，供您参考。<br />\r\n3)当包裹发出时，我们会将订单号、配送的物流公司名称及包裹单号等内容以短信形式通知，请注意保存便于收货时进行相应的核对。<br />\r\n4)包裹发出后，您可以在账户的订单信息中，通过&ldquo;物流跟踪&rdquo;功能查询包裹在途情况。</p>', '', '', '', '0', '1', '1242577023', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('18', '10', '合作机构', '<p>中国二手奢侈品工作委员会</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"146\" height=\"145\" /><br />\r\n中检集团</p>\r\n<p><img src=\"data:image/jpeg;base64,\" alt=\"\" width=\"145\" height=\"145\" /><br />\r\n淘宝</p>\r\n<p><img src=\"data:image/gif;base64,\" alt=\"\" width=\"150\" height=\"129\" /></p>\r\n<p>天猫</p>\r\n<p><img src=\"data:image/jpeg;base64,\" alt=\"\" width=\"137\" height=\"60\" /></p>\r\n<p>京东</p>\r\n<p><img src=\"data:image/jpeg;base64,\" alt=\"\" width=\"143\" height=\"102\" /></p>\r\n<p>乐钱宝</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" width=\"131\" height=\"131\" /></p>\r\n<p>&nbsp;</p>', '', '', '', '0', '1', '1242577127', '', '0', '', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('19', '10', '加盟热线', '<p>加盟热线:400-859-7333<br />\r\n邮箱：3274687585@qq.com</p>', '', '', '', '0', '1', '1242577178', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('20', '10', '公司简介', '<div>浙江博时轩供应链管理有限公司是中国二手奢侈品工作委员会秘书长单位，深耕奢侈品行业8年之久，在价值评估、真伪鉴定等方面拥有国内最权威鉴定资质，是中检集团唯一指定合作奢侈品鉴定机构，在全国有200家鉴定养护中心，为淘宝、京东等知名电商平台提供奢侈品鉴定和养护工作。创始人沈海永先生，为国内知名奢侈品鉴定师，并在2016年被中国二手奢侈品工作委员会聘请担任&ldquo;秘书长&rdquo;一职。沈海永先生就读于浙江大学，于2009年取得工商管理学硕士学位，其带领的博时轩团队中高层领导多为奢侈品行业、金融业等行业内的顶尖人才。<br />\r\n<br />\r\n博时轩旗下官方网站<img src=\"file:///C:\\Users\\ADMINI~1\\AppData\\Local\\Temp\\%W@GJ$ACOF(TYDYECOKVDYB.png\" alt=\"\" />http://www.boshixuan.cn&nbsp;<br />\r\n<br />\r\n成立于2016年，面向客户群体提供三项重要服务：<br />\r\n【1】信息发布。包含新品发布、市场动态、名品时尚圈重大事件等客户较为关心的行业信息发布；<br />\r\n【2】产品展示。即线下实体店内所有货品的产品展示，客户可以从图片、视频、文字描述等多方位了解店内产品新旧、成色、材质、配置等详细情况；<br />\r\n【3】线上交易。即客户若对平台展示产品产生购买意向，可通过在线交易的方式进行购买。<br />\r\n平台历时一年半，运转至今在二手奢侈品交易方面已实现1个亿的交易额。基于强大的市场需求，博时轩团队初步评估若将二手奢侈品工作委员会旗下260家实体店接入平台，同期至少可实现1600个亿的交易量。作为二手奢侈品工作委员秘书长单位，以整合二手奢侈品工作委员会旗下260多家会员单位（线下实体店），建立规范的二手奢侈品销售流程体系，提升整个行业的交易效率和水平为目标，博时轩平台在&ldquo;线上交易&rdquo;部分将流程充分简化、安全化、透明合理化，并增加了分期付款等让客户更有选择余地的付款方式。<br />\r\n<br />\r\n<br />\r\n<img src=\"/images/upload/Image/11.png\" alt=\"\" width=\"250\" height=\"200\" />&nbsp;&nbsp; <img src=\"/images/upload/Image/22.png\" alt=\"\" width=\"250\" height=\"200\" />&nbsp; <img src=\"/images/upload/Image/33.png\" alt=\"\" width=\"250\" height=\"200\" /></div>', '', '', '', '0', '1', '1242577199', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('21', '8', '服务保障', '<p>1、博时轩平台负责产品的鉴定并出具国家权威机构鉴定证书，并郑重承诺，所售商品为真品，如假包退，假一罚十（假货认定需由法院认可的国家鉴定机构出具鉴定凭证为证据）；<br />\r\n2、博时轩平台售出的商品经双方确认并签订购买协议后恕不退换；&nbsp;&nbsp;&nbsp; <br />\r\n3、博时轩平台销售的二手商品有瑕疵或破损属于正常现象，在购买前博时轩平台服务人员或合作机构会向客户告知；&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br />\r\n4、博时轩平台为客户提供有偿维修和维护服务。&nbsp;&nbsp;&nbsp; </p>', '', '', '服务保障', '0', '1', '1242577293', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('22', '8', '价格保护', '<p>由于博时轩平台出售的产品为二手产品，价格根据客户与线下实体店具体沟通作为标准，即便同一品牌和种类的产品价格也各有不同，并且本平台对客户购买的产品进行价格保密。</p>', '', '', '售后', '0', '1', '1242577308', '', '0', 'http://', '');
