\"margin: 0.0px 0.0px 9.0px 0.0px; line-height: 14.4px\"><font style=\"font: 10.5px Helvetica; font-kerning: none; font-variant-ligatures: common-ligatures; color: #000000; -webkit-text-stroke: 0px #000000\" size=\"2\" face=\"Helvetica\" color=\"#000000\">8.76%</font></p>\r\n            </td>\r\n            <td style=\"width: 41.0px; height: 14.0px; border-style: solid; border-width: 1.0px 1.0px 1.0px 1.0px; border-color: #000000 #000000 #000000 #000000; padding: 4.0px 4.0px 4.0px 4.0px\" valign=\"top\">\r\n            <p style=\"margin: 0.0px 0.0px 9.0px 0.0px; line-height: 14.4px\"><font style=\"font: 10.5px Helvetica; font-kerning: none; font-variant-ligatures: common-ligatures; color: #000000; -webkit-text-stroke: 0px #000000\" size=\"2\" face=\"Helvetica\" color=\"#000000\">13.5%</font></p>\r\n            </td>\r\n            <td style=\"width: 33.0px; height: 14.0px; border-style: solid; border-width: 1.0px 1.0px 1.0px 1.0px; border-color: #000000 #000000 #000000 #000000; padding: 4.0px 4.0px 4.0px 4.0px\" valign=\"top\">\r\n            <p style=\"margin: 0.0px 0.0px 9.0px 0.0px; line-height: 14.4px\"><font style=\"font: 10.5px Helvetica; font-kerning: none; font-variant-ligatures: common-ligatures; color: #000000; -webkit-text-stroke: 0px #000000\" size=\"2\" face=\"Helvetica\" color=\"#000000\">18%</font></p>\r\n            </td>\r\n            <td style=\"width: 34.0px; height: 14.0px; border-style: solid; border-width: 1.0px 1.0px 1.0px 1.0px; border-color: #000000 #000000 #000000 #000000; padding: 4.0px 4.0px 4.0px 4.0px\" valign=\"top\">\r\n            <p style=\"margin: 0.0px 0.0px 9.0px 0.0px; line-height: 14.4px\"><font style=\"font: 10.5px Helvetica; font-kerning: none; font-variant-ligatures: common-ligatures; color: #000000; -webkit-text-stroke: 0px #000000\" size=\"2\" face=\"Helvetica\" color=\"#000000\">27%</font></p>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p><br />\r\n分期付款规则：<br />\r\n1. 分期付款所产生的手续费在第一期付款时一次性结清；<br />\r\n2. 分期付款日期按购买日期开始每月一缴，直到最后一期付清为止；<br />\r\n3. 为方便客户分期付款，保证客户每期分期款项及时缴清，客户同意授权平台通过技术手段从客户绑定的银行卡账户扣款；</p>', '', '', '', '0', '1', '1387933402', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('40', '13', '支付问题', '<p>1) 网上支付为什么显示不成功？<br />\r\n银行卡余额不足；银行卡在可用作支付的银行卡范围内，但是用户的卡尚未在发卡行办理网上支付开通手续；支付密码错误；网络通讯故障，包括银 联系统、网络服务商系统、支付发卡行系统、商户系统；客户端电脑系统问题：IE版本低于5.0，不符合支付要求；IE设置不符合要求等等。<br />\r\n2) 到款时间<br />\r\n网上支付均是支付成功即到账。若由于网络故障导致您已支付成功的订单未改变订单状态，请您联系我们的客服人员为您解决。<br />\r\n3) 银行卡的开通<br />\r\n因各地银行政策不同，建议您在网上支付前拨打所在地银行电话，咨询该行可供网上支付的银行卡种类及开通手续。<br />\r\n4) 支付金额上限<br />\r\n目前各银行对于网上支付均有一定金额的限制，由于各银行政策不同，建议您在申请网上支付功能时向银行咨询相关事宜。<br />\r\n5) 怎样判断网上支付是否成功？<br />\r\n当您完成网上在线支付过程后，系统应提示支付成功；如果系统没有提示支付失败或成功，您可通过电话、ATM 、柜台或登录网上银行等各种方式查询银行卡余额，如果款项已被扣除，说明您已支付成功。 如果出现信用卡超额透支、存折余额不足、意外断线等导致支付不成功，请您登录寺库奢侈品网&ldquo;我的帐户&rdquo;，找到该张未支付成功的订单，重新完成支付。<br />\r\n&nbsp;</p>', '', '', '', '0', '1', '1387933422', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('41', '5', '注册新会员', '<p>中国最权威的二手奢侈品交易寄卖平台，博时轩奢侈品平台是中国二手奢侈品工作委员会指定的二手奢侈品平台，博时轩奢侈品交易平台深耕二手奢侈品行业8年之久，在价值评估、真伪鉴定等方面拥有中国最权威的资质证书，博时轩平台与国家质量监督检验检疫总局（AQSIQ）许可、国家认证认可监督管理委员会（CNCA）资质认定、中国合格评定国家认可委员会（CNAS）认可的中国检验认证集团全面合作，为客户在全国两百个城市提供最权威的奢侈品鉴定和产品销售；博时轩平台在全国已经有了260家加盟实体店和200家鉴定养护中心，销售和服务网络遍布全国，博时轩平台承诺，通过平台销售出的产品如有假货，假一赔十！</p>\r\n<p style=\"font-family: \'Lucida Grande\', Arial, \'Microsoft Yahei\', 宋体; line-height: 22px; margin: 0px; padding: 0px; list-style: none; \">&nbsp;</p>\r\n<p>　1、网站注册<br />\r\n(1)、进入博时轩网站后，点击页面左上方&ldquo;<span style=\"color: rgb(255, 0, 0);\">注册</span>&rdquo;，将出现注册页面。</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"\" /><br />\r\n<br />\r\n(2)、在页面右边相应提示处输入您要注册的用户名、密码(密码设置请不要过于简单)、确认密码、电子邮箱等点击&ldquo;注册&rdquo;即可，注册用户名是唯一的。注册成功后，您可以到网站&ldquo;我的帐户&mdash;个人信息管理&rdquo;进行个人信息的更新。<br />\r\n(3)、在订购过程中注册用户，进入博时轩网站&mdash;选择您所需要的商品&mdash;点击放入购物车内&mdash;将出现新页面&mdash;在页面右侧点击&ldquo;注册&rdquo;进入注册页面。</p>\r\n<p style=\"font-family: \'Lucida Grande\', Arial, \'Microsoft Yahei\', 宋体; line-height: 22px; margin: 0px; padding: 0px; list-style: none; \">&nbsp;</p>\r\n<p style=\"font-family: \'Lucida Grande\', Arial, \'Microsoft Yahei\', 宋体; line-height: 22px; margin: 0px; padding: 0px; list-style: none; \">　<span style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; color: rgb(255, 0, 0); \"><strong style=\"font-size: inherit; line-height: inherit; \">　</strong></span><strong style=\"font-size: inherit; line-height: inherit; \"><span style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; color: rgb(255, 0, 0); \"><a href=\"http://b2bc.m43.20w.cc/user.php?act=register\" style=\"font-size: inherit; line-height: 1.5; margin: 0px; padding: 0px; list-style: none; text-decoration: none; color: rgb(153, 153, 153); cursor: pointer; \"><span style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; color: rgb(255, 0, 0); \">点击这里注册新用户</span></a></span><span style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; color: rgb(255, 0, 0); \">&nbsp;&gt;&gt;</span></strong></p>', '', '', '', '0', '1', '1387933513', '', '0', 'http://', '');
