INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('43', '5', '正品保障', '<p>本网站的奢侈品均由中国中检集团和中国二手奢侈品工作委员会提供双料认证，并颁发鉴定证书，该鉴定证书是与产品一对一对应，如经本平台鉴定的产品经国家权威部门鉴定为假货，本平台承诺假一罚十，具体参照客户购买协议。<br />\r\n鉴定证书图片：</p>\r\n<p><img src=\"data:image/jpeg;base64,\" alt=\"\" width=\"453\" height=\"800\" /><img src=\"data:image/jpeg;base64,\" alt=\"\" width=\"451\" height=\"799\" /><img src=\"data:image/png;base64,\" alt=\"\" width=\"454\" height=\"598\" /></p>', '', '', '', '0', '1', '1387933551', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('45', '7', '配送方式', '<p>一、提货流程<br />\r\n1. 您在网站提交预约订单后，待订单状态显示&ldquo;待看货&rdquo;或者收到网站的短信或邮件通知后,可前往相应预约地点提货(其他订单状态请勿前来自提)。<br />\r\n2. 客户到达自提点后,请将订单编号提供给工作人员。<br />\r\n3. 提货时请出示收货人身份证，非本人提货时取货人请出示收货人与取货人身份证。<br />\r\n4. 货物交接时请提供订单编号、收货人姓名并支付货款。<br />\r\n5. 客户签收后取走货物，具体验货签收标准请查看商品验货与签收说明<br />\r\n二、注意事项<br />\r\n1. 到店自提的订单需先支付10%的预订金。<br />\r\n2. 商品到达自提点后，我们将为您保留3天，超过3天默认取消订单。<br />\r\n3. 货款和商品请在自提点前台当面点清，离开提货前台后我司将不再对货款和商品数量负责。<br />\r\n4. 自提点暂不接收任何形式的退换货，请勿将货品邮递或主动送回自提点。<br />\r\n5. 国内所有自提点的到店自提时间为早10：00-晚19：00</p>', '', '', '', '0', '1', '1387933703', '', '0', 'http://', '');
INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('46', '7', '配送说明', '<p>1.商品全场免运费。<br />\r\n2.货到付款客户需加收2%的商品保险费用，详细请查阅配送范围及时间的相关说明。<br />\r\n3.到店自提的客户，需支付10%预订金，到店后再付90%尾款，详细请查阅配送范围及时间的相关说明。</p>', '', '', '', '0', '1', '1387933716', '', '0', 'http://', '');
