INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('80', '21', '网站承诺', '<p>&nbsp;佩戴世界名表，为您加分加魅力！无论是日常生活、情人约会、商务谈判、社交应酬、运动休闲，选择不同款式的手表，让您到哪里都能成为众人瞩目的焦点。</p>\r\n<div>　　万表网百达翡丽、江诗丹顿、宝玑、宝珀、伯爵、朗格、爱彼、积家、格拉苏蒂、法兰克穆勒、欧米茄、劳力士、万国、帝舵、豪雅、卡地亚、爱马仕、君皇、沛纳海、名士、赫柏林、天梭、浪琴、DAVOSA、摩纹、梅花、美度、依波路、爱彼特、英纳格、艾美、摩凡陀、时度、百来苏蒂、西铁城、雅克利曼、蔻驰、卡西欧、东方双狮、Police、芬迪、CELINE、精工男士表，提供美国、德国</div>', '', '', '', '0', '1', '1388971457', '', '0', 'http://', '');
