n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p><br />\r\n分期付款规则：<br />\r\n1. 分期付款所产生的手续费在第一期付款时一次性结清；<br />\r\n2. 分期付款日期按购买日期开始每月一缴，直到最后一期付清为止；<br />\r\n3. 为方便客户分期付款，保证客户每期分期款项及时缴清，客户同意授权平台通过技术手段从客户绑定的银行卡账户扣款；</p>\r\n</div>', '', '', '', '0', '1', '1505105509', '', '0', 'http://', '');
