img/23_thumb_G_1385075287189.jpg', 'images/201311/goods_img/23_G_1385075287524.jpg', 'images/201311/source_img/23_G_1385075287823.jpg', '1', '', '1', '1', '0', '1', '1241971488', '100', '1', '1', '1', '0', '0', '0', '1505152557', '9', '', '-1', '-1', '0', '0', '', '0', '0');
