-align: center; \">&nbsp;</div>\r\n</div>\r\n</div>', 'images/201401/thumb_img/174_thumb_G_1389123943747.jpg', 'images/201401/goods_img/174_G_1389123943179.jpg', 'images/201401/source_img/174_G_1389123943678.jpg', '1', '', '1', '1', '0', '95', '1389221808', '100', '1', '0', '0', '1', '0', '0', '1504955360', '12', '<span>只生产机械表的瑞士中高端品牌</span><br/>\r\n<span>擅长镂空机械表，独家机芯打磨工艺</span><br/>\r\n<span>瑞士机芯装饰工艺和技术改良，以古典机械美学著称</span><br/>', '-1', '-1', '0', '0', '<p>&nbsp;</p>\r\n<div class=\"clear\" style=\"font-family: \'Lucida Grande\', Arial, \'Microsoft Yahei\', 宋体; line-height: 12px; margin: 0px; padding: 0px; list-style: none; clear: both; \">&nbsp;</div>\r\n<div id=\"story\" class=\"column hide story\" style=\"font-family: \'Lucida Grande\', Arial, \'Microsoft Yahei\', 宋体; line-height: 12px; margin: 0px auto; padding: 55px 0px 0px; list-style: none; border-top-width: 1px; border-top-style: solid; border-top-color: rgb(221, 221, 221); position: relative; \">\r\n<div class=\"img floor1\" style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; width: 995px; height: 300px; background-image: url(http://qd.wbiao.cn/img/4.0/goods/story/epos_01.jpg); background-position: 50% 50%; background-repeat: no-repeat no-repeat; \">&nbsp;</div>\r\n<div class=\"story_text\" style=\"font-size: inherit; line-height: inherit; margin: 0px auto 40px; padding: 0px; list-style: none; width: 710px; position: relative; \">\r\n<ul style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; \">\r\n    <li style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; \">\r\n    <div class=\"t\" style=\"font-size: 25px; line-height: inherit; margin: 0px; padding: 40px 0px 15px; list-style: none; color: rgb(51, 51, 51); text-align: center; \">发展历程</div>\r\n    <div class=\"c\" style=\"line-height: inherit; margin: 0px; padding: 0px; list-style: none; width: 710px; \">\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">瑞士独立制表品牌EPOS(爱宝时)，源自希腊文，意指&quot;创世纪的诗文&quot;，该品牌由前宝玑首席设计师Peter Hofer于1983年创立于瑞士著名钟表城比恩市(Bienne)。品牌致力于承续1741年瑞士制表艺术传统，将260多年来呕心沥血的制表艺术发扬光大，为世界表坛开创先河，建立崭新领域融合瑞士古典制表艺术和现代美学创意，勾勒出风格独特的EPOS(爱宝时)系列腕表。</p>\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">在2002年，Peter Hofer寻找到来自瑞士制表企业家族的Ursula Forster可以与他分享对机械表的酷爱，并且愿意接管及发展EPOS(爱宝时)手表公司生意的唯一继任人。</p>\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">Ursula Forster的丈夫泰迪(Tamdi)也在瑞士制表工业中大有经验并赢得2004瑞士巴塞尔(Basel)世界金牌大奖。之后更推出2问表、陀飞轮等多功能复杂机芯。</p>\r\n    </div>\r\n    </li>\r\n</ul>\r\n</div>\r\n<div class=\"img floor2\" style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; width: 995px; height: 300px; background-image: url(http://qd.wbiao.cn/img/4.0/goods/story/epos_02.jpg); background-position: 50% 50%; background-repeat: no-repeat no-repeat; \">&nbsp;</div>\r\n<div class=\"story_text\" style=\"font-size: inherit; line-height: inherit; margin: 0px auto 40px; padding: 0px; list-style: none; width: 710px; position: relative; \">\r\n<ul style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; \">\r\n    <li style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; \">\r\n    <div class=\"t\" style=\"font-size: 25px; line-height: inherit; margin: 0px; padding: 40px 0px 15px; list-style: none; color: rgb(51, 51, 51); text-align: center; \">产品定位</div>\r\n    <div class=\"c\" style=\"line-height: inherit; margin: 0px; padding: 0px; list-style: none; width: 710px; \">\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">承续1741年瑞士制表艺术传统，融合瑞士古典制表艺术和现代美学创意，勾勒出风格独特的EPOS(爱宝时)系列腕表，使EPOS(爱宝时)每个杰作都独一无二，成为极具高收藏价值的微型艺术。</p>\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">EPOS(爱宝时)融合了传统和现代的风格，将目标消费群体锁定于25岁至50岁之间，事业上成功，有文化知识底蕴但不喜欢张扬，主要是较高的文化品位和修养内涵，属于都市精英白领阶层、公务和商务人员等。</p>\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">而在中上阶层中，IT人士大多喜欢简约的生活方式。因此，EPOS(爱宝时)的消费者除了收入可观外，还是一些追求时尚、乐于享受的人群，喜欢名牌所带来的精准与使用。现在您可以放心在万表网（www.wbiao.cn）购买到正品的爱宝时腕表。</p>\r\n    </div>\r\n    </li>\r\n</ul>\r\n</div>\r\n<div class=\"img floor3\" style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; width: 995px; height: 300px; background-image: url(http://qd.wbiao.cn/img/4.0/goods/story/epos_03.jpg); background-position: 50% 50%; background-repeat: no-repeat no-repeat; \">&nbsp;</div>\r\n<div class=\"story_text\" style=\"font-size: inherit; line-height: inherit; margin: 0px auto 40px; padding: 0px; list-style: none; width: 710px; position: relative; \">\r\n<ul style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; \">\r\n    <li style=\"font-size: inherit; line-height: inherit; margin: 0px; padding: 0px; list-style: none; \">\r\n    <div class=\"t\" style=\"font-size: 25px; line-height: inherit; margin: 0px; padding: 40px 0px 15px; list-style: none; color: rgb(51, 51, 51); text-align: center; \">品牌推广</div>\r\n    <div class=\"c\" style=\"line-height: inherit; margin: 0px; padding: 0px; list-style: none; width: 710px; \">\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">每一年春天，文化名城巴塞尔就会演变成国际大都市，因为全世界的注意力都会集中在坐落莱茵河畔的瑞士城。每年平均会有来自全球各大洲的100,000多个零售商、批发商以及百货公司，3000多媒体记者参加。在巴塞尔世界钟表展上，可以看到世界各大著名制表商和珠宝商的全部作品。2013年，EPOS在巴塞尔世界钟表展上的展位是1.2大厅 E29号。届时，EPOS(爱宝时)将会展出其品牌全部的最新款式。</p>\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">2013年，万表网成EPOS(爱宝时)中国地区总代理。</p>\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">代言人：瑞士滑雪追逐赛手--迈克.施密德</p>\r\n    <p style=\"font-size: inherit; line-height: 20px; margin: 0px 0px 20px; padding: 0px; list-style: none; color: rgb(153, 153, 153); \">歌剧演唱家-- Josef Skarka</p>\r\n    </div>\r\n    </li>\r\n</ul>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', '0', '1');
